import React, { Component } from 'react';
import ModalDatPhong from './ModalDatPhong';

class Phong extends Component {

    render() {
        return (
            <div>
                {
                    this.props.ketquas.map((value, key) => {
                        if (value.trangthai === 2) {
                            return (
                                <div id="phong" key={key}>
                                    <img src={value.image} alt="khach san" />
                                    <h2>{value.maphong}</h2>
                                    <h4>{value.gia}</h4>
                                    <h5 style={{ color: "orange" }}>Booking</h5>
                                    {/* <input type="button" name="thuephong" defaultValue="Detail" /> */}
          <button type="button" className="fa fa-address-card-o btn btn-secondary" data-toggle="modal" data-target={"#" + this.props.madaan.keys}></button>

                                </div>
                            )
                        }
                    })
                }
                <ModalDatPhong />
            </div>
        );
    }
}

export default Phong;
